import React from 'react';
import {
  MDBContainer,
  MDBInput,
  MDBBtn
}
from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom';
import { orange } from '@mui/material/colors';

function Register() {
  return (
    <MDBContainer className="p-3 my-5 d-flex flex-column w-50" style={{
        position: 'absolute', left: '50%', top: '50%',
        transform: 'translate(-50%, -50%)',
        border: '10px solid rgba(255, 165, 0, 0.5)',
        padding: '30px'
        }}>
    <p style= { { fontSize: 20 }}> Registracija</p>
      <p>Korisničko ime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'username' style={{height: '30px', width : '250px'}}/>
      <p>Email</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'email' style={{height: '30px', width : '250px'}}/>
      <p>Lozinka</p>
      <MDBInput wrapperClass='mb-4' id='form2' type='password' name = 'password' style={{height: '30px', width : '250px'}}/>
      <p>Ime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'username' style={{height: '30px', width : '250px'}}/>
      <MDBBtn className="mb-4" style={{margin: '20px 0px'}}>Prijava</MDBBtn>

      <div className="text-center">
        <p>Ako nemate račun, možete se <Link to='/register' style={{ color: 'blue' }}>registrirati</Link> </p>
      </div>

    </MDBContainer>
  );
}

export default Register
